import React from 'react';

import {
  LanguageButtonContainer
} from './LanguageButtonStyles';

const LanguageButton = ({ languageCode, handler }) => (
  <LanguageButtonContainer>
    <button onClick={(event) => handler(languageCode, event)}>{languageCode.slice(0, 2)}</button>
  </LanguageButtonContainer>
)

export default LanguageButton;
